import react, {Component} from 'react';
import {Row, Col} from 'reactstrap'

class tavoloGioco extends Component{
    render(){
        return(
            <div>
                <Tavolo/>
            </div>
            
        );
    }
}



class Tavolo extends Component{
    render(){
        return(
            <Row>
                <Col><Colonna/></Col>
								<Col><Colonna/></Col>
								<Col><Colonna/></Col>
								<Col><Colonna/></Col>
								<Col><Colonna/></Col>
								<Col><Colonna/></Col>
            </Row>
        );
    }
}



class Colonna extends Component{
    render(){
        return(
          	this.creaColonne()
        );
		}
		
		creaColonne(){
    let colonna=[];
        for(let i=0;i<6;i++){
            colonna.push(
            <Row><Cella/></Row>
            );
        }
    return colonna;
		}
}


function Cella(props){
    return(
    <Col><button className="square"></button></Col>
    )
}




export default Gioco;
